document.write('<style>');
document.write('#preview_layer{width:314px;height:657px;margin:0px auto;position:fixed;left:500px;top:0px;z-index:10000;	border: 1px solid #999;-moz-border-radius: 15px;-webkit-border-radius: 15px;border-radius:15px; display:none;background-color:#FFF}');
document.write('#preview_layer_back{width:30px;height:30px;position:absolute;top:110px;left:25px;cursor: pointer;}');
document.write('#preview_layer_img{width:440px;height:100%;background:url("data:image/jpg;base64,") no-repeat;margin:0px auto;position:relative}');
document.write('#preview_layer_close {background-image: url("data:image/png;base64,");background-position: -40px 0;cursor: pointer;height: 30px;position: absolute;right: 0px;	top: 0px;width:30px;z-index:1103;}');
document.write('#preview_layer_img iframe{width:267px;height:420px;position:absolute;top:145px;left:25px;}');
document.write('</style>');
//document.write('<div id="preview_layer"> <div id="preview_layer_close"></div><div id="preview_layer_img"><div id="preview_layer_back"></div><iframe class="preview" src="" scrolling="auto" ></iframe></div></div>');
$(document.body).append('<div id="preview_layer"> <div id="preview_layer_close"></div><div id="preview_layer_img"><div id="preview_layer_back"></div><iframe class="preview" src="" scrolling="auto" ></iframe></div></div>');
$.extend({
  preview_layer:function(src){
	   var preview_layer_iframe=$('#preview_layer_img iframe');
	   $('#preview_layer').css({'display':'block'});
	   preview_layer_iframe.attr('src',src);  
  }
});
$("#preview_layer_close").on('click',function(){
	 $('#preview_layer').css({'display':'none'});
})
$("#preview_layer_back").on('click',function(){
	// $('#preview_layer_img iframe').attr('src',src);  
	window.history.go(-1);
})
